export default function Button(props){
    return(
        <button className={`btn ${props.className}`} onClick={props.onClick} id={props.id} style={style}>{props.text}</button>
    );
}

const style = {
    backgroundColor: "#1E1E1E",
    color: "white",
    fontWeight: "bold",
    textTransform: "uppercase",
    borderRadius: "20px",
    padding: "10px",
    border: "1px solid white",
    width: "140px"
}
